import React from "react";
import "../css/favoriteMenu.css";

import { MenuContent } from "../helper/MenuContent";

const Menu = ({ clickHandler }) => {
  return (
    <div>
      <div className=" favorite-page">
        <div className="container">
          <div className="container py-4 d-flex justify-content-evenly ">
            {MenuContent.map((content) => (
              <button
                onClick={clickHandler}
                name={content.name}
                className=" favoriteBtns  me-2 "
              >
                <img name="img" src={content.img} className="me-1" />
                {content.name}
              </button>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};
export default Menu;
